import '../table/table.scss';
import { temp } from '../../utils/temp';

export default function Table(props) {
  console.log(temp);
  return (
    <div className='container'>
        <h2>Commissioning Activities List</h2>
        <ul className="responsive-table">
            <li className="table-header">
                <div className="col-1">Job Id</div>
                <div className="col-2">Activities</div>
                <div className="col-3">disciplines</div>
                <div className="col-4">scope</div>
                <div className="col-4">responsibility</div>
                <div className="col-4">Time</div>
            </li>

            <li className="table-row">
                <div className="col-1" data-label="Job Id">{1}</div>
                <div className="col-2" data-label="Activities">{props.description}</div>
                <div className="col-3" data-label="disciplines">{props.disciplines}</div>
                <div className="col-4" data-label="scope">{props.scope}</div>
                <div className="col-4" data-label="responsibility">{props.Responsibility}</div>
                <div className="col-4" data-label="Time">{props.timing}</div>
            </li>

            {
              
            }

                
        </ul>
    </div>
  )
}
